import "./App.css";
import { useState } from "react";

import {
  BrowserRouter,
  Routes,
  Route,

} from "react-router-dom";


import Home from "./components/Home";
import Search from "./components/Search";



const App = () => {

  return (
    <Routes>
      <Route
        exact
        path="/"
        element={
          <Home />
        }
      ></Route>
      <Route
        exact
        path="/search"
        element={
          <Search />
        }
      ></Route>
    </Routes>
  );
};

export default App;
